class MainActivity : ComponentActivity() {
    override fun onCreate(savedInstanceState: Bundle?) {

        CoroutineScope(Dispatchers.IO).launch {
            insertFlowers()
        }
        super.onCreate(savedInstanceState)
        enableEdgeToEdge()

        val application = this.application as FlowerDeliveryApplication

        val flowerViewModel: FlowerViewModel by viewModels {
            FlowerViewModelFactory.factory(application)
        }

        val feedbackViewModel: FeedbackViewModel by viewModels {
            FlowerViewModelFactory.factory(application)
        }

        val orderViewModel: OrderViewModel by viewModels {
            FlowerViewModelFactory.factory(application)
        }

        setContent {
            FlowerDeliveryTheme {
                Surface(

                    color = MaterialTheme.colorScheme.background
                ) {
                    NavHost()
                }
            }
        }
    }
    private suspend fun insertFlowers() {
        val flowerDao = AppDatabase.getDatabase(this).flowerDao()
        flowerDao.deleteAll()
        val orderDao = AppDatabase.getDatabase(this).orderDao()
        orderDao.deleteOrder(Order(1,		"1718216019838",	"adwadawswww",	listOf(1, 4, 2),	listOf(3,3,2)))
        val flowers = listOf(
            Flower(name = "Sunflower", description = "Bright yellow sunflower", price = 15.0, imageUrl = "data:image/webp;base64,"),
            Flower(name = "Daisy", description = "White daisy with yellow center", price = 8.0, imageUrl = "data:image/jpeg;base64,"),
            Flower(name = "Orchid", description = "Exotic purple orchid", price = 20.0, imageUrl = "data:image/jpeg;base64,"),
            Flower(name = "Rose", description = "Red rose symbolizing love", price = 12.0, imageUrl = "data:image/jpeg;base64,"),
            Flower(name = "Tulip", description = "Colorful tulip in bloom", price = 10.0, imageUrl = "data:image/jpeg;base64,"),
            Flower(name = "Lily", description = "Fragrant white lily", price = 18.0, imageUrl = "data:image/jpeg;base64,"),
            Flower(name = "Carnation", description = "Delicate pink carnation", price = 7.0, imageUrl = "data:image/jpeg;base64,"),
            Flower(name = "Daffodil", description = "Bright yellow daffodil", price = 9.0, imageUrl = "data:image/webp;base64,"),
            Flower(name = "Hydrangea", description = "Blue hydrangea in full bloom", price = 25.0, imageUrl = "data:image/webp;base64,"),
            Flower(name = "Peony", description = "Pink peony with delicate petals", price = 14.0, imageUrl = "data:image/webp;base64,")
        )

        // Insert each flower into the database
        flowers.forEach { flower ->
            flowerDao.insertFlower(flower)
        }
    }
}


